--------------------------------------------------------
--  DDL for View HV_GEO_DIM
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "RIGEL"."HV_GEO_DIM" ("BRANCH_GEOID", "BRANCH", "CITY", "STATE", "COUNTRY") AS 
  SELECT DISTINCT BRANCH.GEO_ID BRANCH_GEOID,
  BRANCH.GEO_DESC1 BRANCH,
        CITY.GEO_DESC1 CITY,
    STATE.GEO_DESC1 STATE,
     CRTY.GEO_DESC1 COUNTRY
  FROM 
    UM_GEOGRAPHY CRTY,
    UM_GEOGRAPHY STATE,
    UM_GEOGRAPHY CITY,
    UM_GEOGRAPHY BRANCH
WHERE 
 BRANCH.ORG_ID = 777
     AND STATE.LEVEL_PRED_ID = CRTY.GEO_ID
  AND CITY.LEVEL_PRED_ID  = STATE.GEO_ID
  AND BRANCH.LEVEL_PRED_ID  = CITY.GEO_ID;
REM INSERTING into RIGEL.HV_GEO_DIM
SET DEFINE OFF;
